function Vid() {
    return (
        <div className="main_vid">
        <header className="title-playing">Golu</header>
        <div className="play_area me-2">
            <video controls style="width: 100%; max-width: 1000px;">
            <source
                src={`${process.env.PUBLIC_URL}/test1.mp4`}
                type="video/mp4"
            />
            <track
                src={`${process.env.PUBLIC_URL}/sub.srt`}
                label="English"
                kind="captions"
                srclang="en-us"
                default
            />
            Your browser does not support the video tag.
            </video>
        </div>
        </div>
    );
}

export default Vid;
